import React from "react";
import "./Project.css";

function Project() {
  return (
    <div className="project component__space">
      <div className="heading">
        <h1 className="heading"> My Latest Project </h1>
        <p className="heading p__color">
          There are many variations of lorem Ipsum Avilable,
        </p>
        <p className="heading p__color">but some of projects are here</p>
      </div>
      <div className="container">
          <div className="row">

            <div className="col__3">
                <div className="project__box pointer">
                    <div className="project__img__box pointer relative">

                    </div>

                </div>
            </div>

          </div>

      </div>
    </div>
  );
}

export default Project;
